Neighbor Affair - Chanel Preston

Actors: Chanel Preston, Mick Blue

Release Date: November 25, 2010

Who: Friend, Neighbor,

Where: Couch, Living room,

Chanel is very nervous about going to her parents for Thanksgiving dinner. Her neighbor Mick is going to be her date for the day, but she still knows that she is going to get grilled by her entire family. Mick reassures her about the situation, he knows how to smooth talk parents and besides if she is really that stressed out about the day....then Mick also knows how to calm her down....with a nice sex session.
